import React, {Component, useEffect, useState} from 'react';
import './ComicDisplay.css';
import axios from 'axios';
import {buttonReducer} from "../Data/buttonReducer";
import {configureStore} from '@reduxjs/toolkit';
import { connect } from 'react-redux';

class ComicDisplay extends Component {
    render () {
        const {number} = this.props.number;

        return (
            <div>{number}</div>
        )
    }
}

const mapStateToProps = state => {
    return {
        number: state.number,
        url: state.url
    };
};
const mapDispatchToProps = dispatch => {
    return {
        handlePreviousClick: () => dispatch({ type: 'PREVIOUS' }),
        handleNextClick: () => dispatch({ type: 'NEXT' }),
        handleRandomClick: () => dispatch({ type: 'RANDOM' })
    }
};

export default connect(mapStateToProps, mapDispatchToProps)(ComicDisplay);
